def openFile(filename):
    '''Open a file'''
    f =open(filename)
    return f.readlines()

seqA =""
seqB=''



def hammingDistance(seqA,seqB):
    i=0
    d=0
    while i< len(seqA):
        if seqA[i]!=seqB[i]:
            d+=1
        i+=1
    return d

distance=hammingDistance(seqA,seqB)
print(distance)